(self.webpackChunkblog=self.webpackChunkblog||[]).push([[5386],{6051:(e,s,n)=>{"use strict";n.r(s),n.d(s,{data:()=>a});const a={key:"v-261b5f62",path:"/tools/git/some-of-the-branches-are-commit.html",title:"Git拉取远程分支到本地",lang:"zh-CN",frontmatter:{},excerpt:"",headers:[],filePathRelative:"tools/git/some-of-the-branches-are-commit.md",git:{updatedTime:1639727585e3,contributors:[]}}},1316:(e,s,n)=>{"use strict";n.r(s),n.d(s,{default:()=>i});const a=(0,n(6252).uE)('<h1 id="git拉取远程分支到本地" tabindex="-1"><a class="header-anchor" href="#git拉取远程分支到本地" aria-hidden="true">#</a> Git拉取远程分支到本地</h1><p>Git拉取远程分支其实只需要 <code>git fetch origin xxx</code>、 <code>git pull origin xxx</code>两步即可。</p><p>比如，拉取GitHub上面的仓库中的<code>step1</code>分支。</p><ol><li>确保本地分支和远程<code>origin master</code>建立了连接：</li></ol><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code><span class="token function">git</span> remote <span class="token function">add</span> origin git@github.com:xxxxxx.git //<span class="token punctuation">(</span>你的远程仓库<span class="token punctuation">)</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><ol start="2"><li>切换分支</li></ol><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code><span class="token function">git</span> checkout -b step1 origin/step1\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><p>如果遇到这种情况：</p><blockquote><p><strong>fatal:</strong> Cannot update paths and switch to branch &#39;dev&#39; at the same time. Did you intend to checkout &#39;origin/dev&#39; which can not be resolved as commit?</p></blockquote><p>原因是本地仓库并没有<code>step1</code>这个分支。</p><p>这时可以用<code>git branch -a</code>命令来检查本地是否具有<code>step1</code>分支</p><ul><li>拉取远程分支到本地</li></ul><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code><span class="token function">git</span> fetch origin step1 \n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><ul><li>本地创建并切换到分支</li></ul><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code><span class="token function">git</span> checkout -b step1 origin/step\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><ul><li>拉取远程分支到本地</li></ul><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code><span class="token function">git</span> pull origin step1\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div>',17),i={render:function(e,s){return a}}}}]);